        /// <summary>
        /// Sends graph data to react app
        /// </summary>
        /// <param name="data"></param>
        private async void LoadGraphs(List<StartPageListItem> data)
        {
            if (data == null) { return; }
            string jsonData = JsonSerializer.Serialize(data);

            if (dynWebView?.CoreWebView2 != null)
            {
                await dynWebView.CoreWebView2.ExecuteScriptAsync(@$"window.receiveGraphDataFromDotNet({jsonData})");
            }
        }

        /// <summary>
        /// Sends samples data to react app
        /// </summary>
        private async void SendSamplesData()
        {
            if (!this.startPage.SampleFiles.Any()) return;

            string jsonData = JsonSerializer.Serialize(this.startPage.SampleFiles);

            if (dynWebView?.CoreWebView2 != null)
            {
                await dynWebView.CoreWebView2.ExecuteScriptAsync(@$"window.receiveSamplesDataFromDotNet({jsonData})");
            }
        }

        private async void SendRecentGraphsData()
        {
            // Send user preferences
            if (dynWebView?.CoreWebView2 != null)
            {
                if (startPage.DynamoViewModel.PreferenceSettings.HomePageSettings != null)
                {
                    var dict = GetDictFromListStrings(startPage.DynamoViewModel.PreferenceSettings.HomePageSettings);
                    var settingsJson = Newtonsoft.Json.JsonConvert.SerializeObject(dict);
                    settingsJson = System.Web.HttpUtility.JavaScriptStringEncode(settingsJson);

                    await dynWebView.CoreWebView2.ExecuteScriptAsync(@$"window.setHomePageSettings('{settingsJson}');");
                }
            }

            // Load recent files
            var recentFiles = startPage.RecentFiles?.DistinctBy(x => x.ContextData).ToList();
            if (recentFiles != null && recentFiles.Any())
            {
                LoadGraphs(recentFiles);
            }

            if (startPage.DynamoViewModel != null && startPage.DynamoViewModel.RecentFiles != null)
            {
                startPage.DynamoViewModel.RecentFiles.CollectionChanged += RecentFiles_CollectionChanged;
            }
        }

