        #region Interactive Guides Commands
        internal void ShowGuidedTour(string typeString)
        {
            if (!Enum.TryParse(typeString, true, out GuidedTourType type))
            {
                return;
            }

            switch (type)
            {
                case GuidedTourType.UserInterface:
                    // This is the LandingPage, so we need to open a blank Workspace before running the Guided Tours
                    NewWorkspace();
                    ShowUserInterfaceGuidedTour();  
                    break;
                case GuidedTourType.GetStarted:
                    ShowGettingStartedGuidedTour();
                    break;
                case GuidedTourType.Packages:
                    // This is the LandingPage, so we need to open a blank Workspace before running the Guided Tours
                    NewWorkspace();
                    ShowPackagesGuidedTour();
                    break;
            }
        }

        private void ShowUserInterfaceGuidedTour()
        {
            //We pass the root UIElement to the GuidesManager so we can found other child UIElements
            try
            {
                this.startPage.DynamoViewModel.MainGuideManager.LaunchTour(GuidesManager.GetStartedGuideName);
            }
            catch (Exception)
            {
                return;
            }
        }

        private void ShowGettingStartedGuidedTour()
        {
            try
            {
                if (this.startPage.DynamoViewModel.ClearHomeWorkspaceInternal())
                {
                    this.startPage.DynamoViewModel.OpenOnboardingGuideFile();
                    this.startPage.DynamoViewModel.MainGuideManager.LaunchTour(GuidesManager.OnboardingGuideName);
                }
            }
            catch (Exception ex)
            {
                this.startPage.DynamoViewModel.Model.Logger.Log(ex.Message);
                this.startPage.DynamoViewModel.Model.Logger.Log(ex.StackTrace);
            }
        }

        private void ShowPackagesGuidedTour()
        {
            try
            {
                this.startPage.DynamoViewModel.MainGuideManager.LaunchTour(GuidesManager.PackagesGuideName);
            }
            catch (Exception)
            {
                return;
            }
        }

        #endregion

        #region Relay Commands
        internal void OpenFile(string path)
        {
            if (String.IsNullOrEmpty(path)) return;
            if (DynamoModel.IsTestMode)
            {
                TestHook?.Invoke(path);
                return;
            }

            if (this.startPage.DynamoViewModel.OpenCommand.CanExecute(path))
                this.startPage.DynamoViewModel.OpenCommand.Execute(path);
        }

        internal void StartGuidedTour(string path)
        {
            if (String.IsNullOrEmpty(path)) return;
            if (DynamoModel.IsTestMode)
            {
                TestHook?.Invoke(path);
                return;
            }

            ShowGuidedTour(path);
            Logging.Analytics.TrackEvent(Logging.Actions.Start, Logging.Categories.DynamoHomeOperations, "Guided Tour: " + path);

        }

        internal void SaveSettings(string settingsJson)
        {
            if (!string.IsNullOrEmpty(settingsJson) && this.startPage != null)
            {
                var settingsDict = Newtonsoft.Json.JsonConvert.DeserializeObject<Dictionary<string, string>>(settingsJson);

                // If the HomePageSettings have not been previously created, initialize it now
                if (startPage.DynamoViewModel.PreferenceSettings.HomePageSettings == null)
                {
                    startPage.DynamoViewModel.PreferenceSettings.HomePageSettings = new List<string>();
                }

                var dict = GetDictFromListStrings(startPage.DynamoViewModel.PreferenceSettings.HomePageSettings);

                // Change existing values, or add new ones
                foreach (var setting in settingsDict)
                {
                    if (dict.ContainsKey(setting.Key))
                    {
                        if (dict[setting.Key] == setting.Value) continue;
                        dict[setting.Key] = setting.Value;
                    }
                    else
                    {
                        dict.Add(setting.Key, setting.Value);
                    }   
                }

                SetListStringsFromDict(dict, startPage.DynamoViewModel.PreferenceSettings.HomePageSettings);
            }
        }

        private void SetListStringsFromDict(Dictionary<string, string> dict, List<string> homePageSettings)
        {
            homePageSettings.Clear();
            foreach (var kvp in dict)
            {
                homePageSettings.Add($"{kvp.Key}:{kvp.Value}");
            }
        }

        private Dictionary<string, string> GetDictFromListStrings(List<string> homePageSettings)
        {
            var dict = new Dictionary<string, string>();
            if (!homePageSettings.Any()) return dict;

            try
            {
                dict = homePageSettings.Select(item => item.Split(':'))
                                       .Where(parts => parts.Length == 2)
                                       .ToDictionary(parts => parts[0], parts => parts[1]);
            }
            catch(Exception ex)
            {
                this.startPage.DynamoViewModel.Model.Logger.Log("Failed to load HomePageSettings: " + ex.Message);
            }

            return dict;
        }

